@Nihilarity @billybragg @Jane66588568 @void_if_removed @twtomwilson Medically, there is no reason a 12 year old kid cannot tattoo a character from Roblox on their face. 
A doctor would permit such a procedure to the child since it would not seriously harm the child physically.
However, the law says that is not permitted. And for good reason.
